 Europe. In Lithuania, Latvia, and Estonia theatrical premiere happened on the 28th of February▪ #tommyflanagan #therisinghawk #movie #film #onset #movietime #actor #polishgirl #polskadziewczyna #ukraine #moviemaking #actorslife #soa #soafx #sonsofanarchy #kyiv #movierelease #zakharberkut #therisinghawkmovie #therisinghawkfilm #zakharberkutfilm";}i:4;a:1:{s:14:"comments_count";i:0;}i:5;a:1:{s:11:"likes_count";i:0;}i:6;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvYMsSgocy";}i:7;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118766449_233349641408177_8549136458341851876_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=pmoPSsnTRIsAX_2k55R&oh=742c9d21b5600798e5dfd135c16f6a69&oe=5F7C9B8D";}i:8;a:1:{s:4:"type";s:5:"image";}i:9;a:1:{s:8:"owner_id";i:1649441294;}i:10;a:1:{s:14:"owner_username";s:0:"";}i:11;a:1:{s:14:"owner_fullname";s:0:"";}i:12;a:1:{s:9:"owner_pic";s:0:"";}i:13;a:1:{s:2:"id";s:19:"2391235293418378565";}i:14;a:1:{s:10:"short_code";s:11:"CEvX9R-lFVF";}i:15;a:1:{s:12:"created_time";i:1599277482;}i:16;a:1:{s:7:"caption";s:463:"Following up VFW ( which was batshit and I enjoyed the hell out of it ) with an all time favorite. Watching on Prime not my DVD, the quality is so much better, would be a dream to have it on blu one day.
