Review - This subject of police encounters is not new and here the treatment is also not innovative except Bobby Deol as the dean Vijay Singh of police training academy.It is  loosely based on S. Hussain Zaidi's book, The Class of '83: The Punishers Of Mumbai Police,.
Class of 83 is a gritty drama about a batch of police officers trained at Nashik,who become famed encounter specialists in Bombay.
Notorious gangsters.used to rule Mumbai with the help of politicians in 1980s.
The book is based on  real-life cops, like Pradeep Sharma and Vijay Salaskar, who trained under DGP Arvind Inamdar when he was head of the Maharashtra Police Academy..But the movie claims to be fictional and justifies the encounter by Plato's philosophy of
 "Good people do not need laws to tell them to act responsibly, while bad people will find a way around the laws."
To cast forgotten hero Bobby was the experiment and he also does the experiment with five cadets :played by newcomers Ninad Mahajani, Bhupendra Jadawat, Sameer Paranjape, Hitesh Bhojraj and Prithvik Pratap, all of whom have acted well.
 There are few good scenes and Bombay of 80s is well depicted but thats all.
Everything you have seen ampteen times,so 
director  Atul Sabharwal offers you same old wine in old bottle.
This class is now streaming on Netflix and attend this class only if you dont have anything else to do,otherwise just bunk it!";}i:30;a:1:{s:14:"comments_count";i:1;}i:31;a:1:{s:11:"likes_count";i:1;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvXaI4lrC9";}i:33;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118766203_759382041550959_5557377298192302424_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=cGkswI-n_ucAX9c1TPD&oh=56fb76708b235c9e6ecc63a1a8afadb3&oe=5F7C8D09";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:33533700452;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391232578831405749";}i:40;a:1:{s:10:"short_code";s:11:"CEvXVx0llK1";}i:41;a:1:{s:12:"created_time";i:1599277158;}i:42;a:1:{s:7:"caption";s:514:"Chaala fast unnaru local channel vallu..😂 
